import React from 'react'
import "./Sidebar.scss"
import DashboardCustomizeRoundedIcon from '@mui/icons-material/DashboardCustomizeRounded';
import GridViewRoundedIcon from '@mui/icons-material/GridViewRounded';
import ViewInArIcon from '@mui/icons-material/ViewInAr';
import PortraitOutlinedIcon from '@mui/icons-material/PortraitOutlined';
import ContactSupportOutlinedIcon from '@mui/icons-material/ContactSupportOutlined';
import DownloadingIcon from '@mui/icons-material/Downloading';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';

function Sidebar() {
  return (
    <div className='sidebar'>
    <div className='top'><DashboardCustomizeRoundedIcon className='icon1'/><span className='logo'>Dashboard</span></div>
    <div className='center'>
    <ul>
    <li><GridViewRoundedIcon className='icon'/><span>Dashboard</span></li>
    <li><ViewInArIcon className='icon'/><span>Product</span></li>
    <li><PortraitOutlinedIcon className='icon'/><span>Customers</span></li>
    <li><DownloadingIcon className='icon'/><span>Income</span></li>
    <li><TrendingUpIcon className='icon'/><span>Promote</span></li>
    <li><ContactSupportOutlinedIcon className='icon'/><span>Help</span></li>
    </ul></div>
    <div className='bottom'></div>





    </div>
  )
}

export default Sidebar
